  return (
    <div>
      <div className="mainAddMedicament">
        <div className="container d-flex align-items-center justify-content-center  pt-5">
          <form>
            <div className="row">
              <h1 className="text-center mt-2 mb-4">Order Information</h1>
              <div className="col-sm-6 ">
                <div className="mb-3 mt-3">
                  <label htmlFor="Name" className="form-label">
                    Name:
                  </label>
                  <input
                    type="text"
                    className="form-control"
                    id="nameMedicament"
                    placeholder="Enter name"
                    name="Name"
                    // value={med.nameMed}
                    // onChange={changeMed}
                  />
                </div>
                <div className="mb-3 mt-3">
                  <label htmlFor="address" className="form-label">
                    Adress
                  </label>
                  <input
                    type="text"
                    className="form-control"
                    id="weightMedicament"
                    placeholder="Enter Addrees"
                    name="address"
                    // value={med.weight}
                    // onChange={changeMed}
                  />
                </div>
                <div>
                  <button type="button" className="mb-3 mt-3 btn btn-success" onClick={createSpace}>
                    Add Medicament
                  </button>
                </div>
                <div>
                  <button type="button" className="mb-3 mt-2 btn btn-success">
                    Order Recipe
                  </button>
                </div>
              </div>
            </div>
          </form>
        </div>
      </div>
    </div>
  );
}

export default Command;
